const HeaderAdmin = () => {
    return (
        <header className='admin-header'>
            <a href='/admin-page'><img className='logo-admin-page' alt='This is a logo'/></a>
            <p className='logo-text-admin-main-page'><a href='/main-page'>Food Panda</a></p>
        </header>
    )
}

export default HeaderAdmin
